import React from "react";

import Navbar from "../navbar/navbar.component";

const WithNavbar = (WrappedComponent) => {
  return <Navbar />;
  const Component = ({ ...otherProps }) => {
    return <WrappedComponent {...otherProps} />;
  };
  return Component;
};

export default WithNavbar;
